import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({

    typography: {
        fontFamily: [
            'Montserrat',
        ]
    },
    palette: {
        primary: {
            main: '#FF9E58',
        },
        secondary: {
            main: '#C1DEEB',
        },
        tertiary: {
            main: '#FFAC00',
        },
    },

    overrides: {
        MuiButton: {
            label: {
                fontSize: 16,
            }
        }
    }
  });

export default theme
